import axios from 'axios';

const ActivitiesService = {
    getActivities: async function() {
        const activitiesUrl = `${process.env.REACT_APP_STARDUST_BASE_URL}${process.env.REACT_APP_STARDUST_WP_API}/activities`
        return await axios.get(activitiesUrl);
    }
};

export default ActivitiesService;
